public int hashCode() {
  // generated by eclipse
  final int prime = 31;
  int result = 1;
  result =
      prime * result
          + (int) (getClusterTimestamp() ^ (getClusterTimestamp() >>> 32));
  result = prime * result + (int) (getId() ^ (getId() >>> 32));
  return result;
}
